import React from "react"


function DeckList({ onRemove, myDeckList }) {


if (myDeckList) {
    const personalList= myDeckList.filter(result => result.imageUrl);
    return (<div>
        {personalList.map((cardData)=> {

            return(
            <ul key={cardData.id}>
                <li>
                    <img id={cardData.id} onClick={onRemove} alt={`${cardData.name}`} src={`${cardData.imageUrl}`} />
                    <p>Set: {cardData.setName}</p>
                </li>
            </ul>
        )})}
    </div>)}

    else {return (
        <div>
            <h2>Add to your Deck List from the Search!</h2>
        </div>
    )}
}

export default DeckList;
